  return (

    <div className="App">
      <h1>DailyLog</h1>
      <div className="DailyLog">
        <div className='macros'>
          <h2>Macros:</h2>
          <div className='macroInput'>
            <input type="date" id="start" name="Macro-Data" value="2018-07-22" min="2018-01-01" max="2018-12-31" />
