            <input type="number" id="carb" placeholder="Carbs (in grams)" min="0" max="10000" />
            <input type="number" id="fat" placeholder="Fat (in grams)" min="0" max="10000" />
          </div>
        </div>
        <div className='FitnessTracker'>

      <input type="number" id="actMin" placeholder="Time (in minutes)" min="0" max="10000" />

      </div>

      </div>

      <div className='DailyTotals'>
          <div className='currentTotals'>
              <h1>DailyTotals</h1>
          </div>

          <div className='RemainingCal'>

          </div>

      </div>



    </div>
  );
}

export default App;
